const SCOPE = 'user';
const CLIENT_ID = 'c422829926c86ed64a91';
const CLIENT_SECRET = '53f09fa548201825683d6e5598a816eea17eb58e';
// 'https://github.com/login/oauth/authorize?client_id=c422829926c86ed64a91&scope=user'
//const OAUTH_URL = `${BASE_URL}?client_id=${CLIENT_ID}&scope=${SCOPE}`;
const OAUTH_URL = `https://github.com/login/oauth/authorize?client_id=${CLIENT_ID}&scope=user`;
const TOKEN_URL = 'https://github.com/login/oauth/access_token';
const USER_URL = 'https://api.github.com/user';
const REPOSITY_URL = 'https://api.github.com/search/repositories?q=react';
module.exports = {
  CLIENT_ID,
  CLIENT_SECRET,
  OAUTH_URL,
  TOKEN_URL,
  USER_URL,
  REPOSITY_URL,
};
